import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

const Carou = ({ children }) => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    responsive: [
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 1,
          infinite: true,
          dots: true,
        },
      },
      {
        breakpoint: 600,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
          initialSlide: 1,
        },
      },
    ],
  };

  return (
    <div className="mx-auto w-full">
      <Slider
        {...settings}
        className="outline-none"
        dotsClass="slick-dots flex justify-center"
        nextArrow={<NextArrow />}
        prevArrow={<PrevArrow />}
      >
        {children}
      </Slider>
    </div>
  );
};

const NextArrow = (props) => (
  <button
    {...props}
    className="absolute top-1/2 right-0 transform -translate-y-1/2 focus:outline-none"
  >
    <svg
      className="w-6 h-6 text-white"
      viewBox="0 0 24 24"
      fill="none"
      stroke="currentColor"
      strokeWidth="2"
      strokeLinecap="round"
      strokeLinejoin="round"
    >
      <path d="M9 18l6-6-6-6" />
    </svg>
  </button>
);

const PrevArrow = (props) => (
  <button
    {...props}
    className="absolute top-1/2 left-0 transform -translate-y-1/2 focus:outline-none"
  >
    <svg
      className="w-6 h-6 text-white"
      viewBox="0 0 24 24"
      fill="none"
      stroke="currentColor"
      strokeWidth="2"
      strokeLinecap="round"
      strokeLinejoin="round"
    >
      <path d="M15 18l-6-6 6-6" />
    </svg>
  </button>
);

export default Carou;
